/*Table structure for table `site_pages` */

CREATE TABLE `site_pages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uri` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `header` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `text` text CHARACTER SET utf8,
  `visible` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `update_time` datetime NOT NULL,
  `order` int(10) unsigned NOT NULL DEFAULT '999',
  `pid` int(10) unsigned NOT NULL,
  `meta_kw` text CHARACTER SET utf8,
  `meta_descr` text CHARACTER SET utf8,
  `html_title` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `upper_text` text CHARACTER SET utf8 COMMENT ' ',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uri` (`uri`),
  KEY `pid_visible_order` (`visible`,`order`,`pid`)
